De Londense bankier Max Skinner vertrekt voor het afhandelen van een erfenis naar de Provence in Frankrijk. Zijn oom Henry laat 
hem een landgoed en een aangrenzende wijngaard na, maar Max wil alles zo snel mogelijk verkopen. Eenmaal in Frankrijk aangekomen, 
ontmoet hij de mooie Fanny. Wat begint als een kort zakenbezoek, loopt al snel uit tot een veel langer verblijf. Maar dan komt 
plots Christie op de proppen die beweert een buitenechtelijk kind van Henry te zijn:
